am\n> ON DAMAGE TAKEN: Poison spray\n> ON HIT HUMAN: Ghoul Touch"LANGUAGE.controls_headcrab="> PRIMARY: Lunge attack\n> RELOAD: Burrow\n> SPRINT: DASH"LANGUAGE.controls_fast_headcrab="> PRIMARY: Lunge attack"LANGUAGE.controls_bloodsucker_headcrab="> PRIMARY: Lunge attack\n> ON HIT HUMAN: Bleed and heal for a small amount of health"LANGUAGE.controls_poison_headcrab="> PRIMARY: Lunge attack\n> SECONDARY: Spit poison\n> ON BITE HUMAN: Increased Poison DOT\n> ON HIT HUMAN: Poison\n> ON HIT POISON IN EYES: Blind\n> RELOAD: Scream\n> SPRINT: Dash"LANGUAGE.controls_reviver="> PRIMARY: Lunge attack\n> SECONDARY: Spit shock\n> ON BITE HUMAN: Inflict Shock\n> ON HIT HUMAN: Shock and Tazed\n> RELOAD: Ink Pool\n> SPRINT: Transform into Plasma Ball"LANGUAGE.controls_barbed_headcrab="> PRIMARY: Lunge attack\n> SECONDARY: Spit poison\n> ON HIT HUMAN: Increased Poison DOT\n> ON HIT HUMAN: Poison\n> ON HIT POISON IN EYES: Blind\n> RELOAD: Quill Spray\n> SPRINT: Dash"LANGUAGE.controls_carrion_headcrab="> PRIMARY: Lunge attack\n> ON HIT HUMAN: Bleed and heal for a small amount of health, on top of applying dim vision\n> RELOAD: Burrow"LANGUAGE.controls_the_tickle_monster="> PRIMARY: Elastic claws\n> SECONDARY: Tickle"LANGUAGE.controls_nightmare="> PRIMARY: Nightmare Claws\n> SECONDARY: Quick Claw\n> SPRINT: Shadow Run\n> SPRINT WHILE SHADOW RUN: Nightmare burst\n> ON HIT HUMAN: +3 damage per consecutive hit on same human"LANGUAGE.controls_darkmare="> PRIMARY: Nightmare Claws\n> SECONDARY: Quick Claw\n> SPRINT: Shadow Run\n> SPRINT WHILE SHADOW RUN: Nightmare burst\n> ON HIT HUMAN: +2.5 damage per consecutive hit on same human"LANGUAGE.controls_shadowmare="> PRIMARY: Nightmare Claws\n> SECONDARY: Quick Claw\n> SPRINT: Shadow Run\n> SPRINT WHILE SHADOW RUN: Nightmare burst\n> ON HIT HUMAN: +2.5 damage per consecutive hit on same human"LANGUAGE.controls_ancient_nightmare="> PRIMARY: Death Claws\n> SECONDARY: Nightmare Dash\n> ON HIT HUMAN: Inflict Nightmare Status, decrease Nightmare Fog