age, increasing attack speed\n> SECONDARY: Throw Knife\n> ON THROWN KNIFE HIT: Maim, Prey debuff and build Rage\n> RELOAD: Enrage\n> ON ENRAGE: Increased attack/movement speed to self and nearby allies"LANGUAGE.controls_gravedigger="> PRIMARY: Shovel Swing\n> HOLD PRIMARY: Charged Shovel Swing\n> ON HEADSHOT: Bonus Damage\n> SECONDARY: Throw Shovel\n> RELOAD: Dig Gravestone\n> GRAVE STONES: Increased attack/movement speed for every active gravestone.\n> GRAVE STONE DESTROYED: Enrage all nearby undead. Inflict prey and dim vision on nearby humans."LANGUAGE.controls_flesh_creeper="> PRIMARY: Claw\n> SECONDARY: Construct nest\n> RELOAD: Leap\n> SPRINT: Channel flesh spitting. Increased accuracy & firerate when attacking.\n> ON FLESH SPIT HIT: Anchor"LANGUAGE.controls_gore_child="> PRIMARY: Claws"LANGUAGE.controls_giga_gore_child="> PRIMARY: Smash\n> SECONDARY: Throw Gore Child bomb\n> RELOAD: Cry\n> ON CRY: Greatly increased movement speed. Slow & Prey humans. Teleport all children to self"LANGUAGE.controls_giga_shadow_child="> PRIMARY: Smash\n> SECONDARY: Throw Shadow Child bomb\n> RELOAD: Obscuring Knockdown Cry\n> ON HIT: Dim Vision\n> ON HIT BY MELEE: Resist damage"LANGUAGE.controls_shadow_gore_child="> PRIMARY: Claws\n> ON HIT: Dim Vision\n> ON HIT BY MELEE: Resist damage"LANGUAGE.controls_asskicker="> PRIMARY: Left kick\n> SECONDARY: Right kick"LANGUAGE.controls_shitslapper="> PRIMARY: Slap\n> RELOAD: Slap Force\n> SPRINT: Prepare Shit Slap\n> ON SLAP FORCE: Causes a small radial earthquake where you propel yourself and humans around you upward.\n> ON SHIT SLAP READY: Knocks down all humans hit for 3 seconds."LANGUAGE.controls_doomcrab="> PRIMARY: Leap attack\n> SECONDARY: Doom ball\n> RELOAD: Dark nova on self"LANGUAGE.controls_red_marrow="> PRIMARY: Claws\n> SECONDARY: Blood Shield\n> BLOOD SHIELD: Reduce damage taken while healing self and nearby undead. Protects undead from harmful statuses. Increases movement speed. \n> BLOOD SHIELD NEAR HUMANS: Steals blood