GetPos())c:SetAngles(b:GetAngles())c:SetScale(0.7)util.Effect("headcrab_largedig",c,nil,true)end;if SERVER then if d then self:SetBurrowingStamina(math.max(self:GetBurrowingStamina()-0.01,0))else self:SetBurrowingStamina(math.min(self:GetBurrowingStamina()+0.025,1))end end end end elseif self:GetBurrowTime()<0 and a>=-self:GetBurrowTime()then self:SetBurrowTime(0)elseif self:IsPouncing()then local e=b:GetMeleeSpeedMul()if b:WaterLevel()>=2 or b:IsOnGround()and self:GetFireMode()==1 then self:SetPouncing(false)self:SetNextPrimaryFire(a+self.NoHitRecovery*e)else local f=b:GetShootPos()local g=b:CompensatedPenetratingMeleeTrace(20,self.MeleeSize,f,b:GetForward(),false,64)for h,i in pairs(g)do local j=i.Entity;if i.Hit then self:SetPouncing(false)self:SetNextPrimaryFire(a+self.HitRecovery*e)end;if j:IsValid()and not j.IsCreeperNest then if SERVER then self:EmitBiteSound()end;local k=self.PounceDamage;if j:IsPlayer()then k=self.PounceDamageVsHumans;j:MeleeViewPunch(k*3)if SERVER then local l=j:NearestPoint(f)util.Blood(l,math.Rand(k*0.5,k*0.75),(l-f):GetNormalized(),math.Rand(k*5,k*10),true)j:ThrowFromPositionSetZ(f,200,nil,true)end else local m=j:GetPhysicsObject()if m:IsValid()and m:IsMoveable()then m:ApplyForceOffset(k*600*b:EyeAngles():Forward(),(j:NearestPoint(f)+j:GetPos()*2)/3)j:SetPhysicsAttacker(b)end end;j:TakeSpecialDamage(k,self.PounceDamageType,b,self,i.HitPos)b:ViewPunch(Angle(math.Rand(-10,10),math.Rand(-10,10),math.Rand(-10,10)))elseif i.HitWorld then if SERVER then self:EmitHitSound()end end end end;if b:OnGround()and b:IsOnGround()then self:SetPouncing(false)self:SetNextPrimaryFire(a+self.NoHitRecovery*e)if SERVER then self:PoundAttackProcess()end end end;self:NextThink(a)return true end;function SWEP:EmitBiteSound()self:GetOwner():EmitSound(")npc/antlion_guard/shove1.wav",self.HitAtten,math.random(130,140),self.HitVolume,CHAN_WEAPON)end;function SWEP:EmitHitSound()self:GetOwner():EmitSound(string.format(")npc/headcrab_poison/ph_wallhit%d.wav",math.random(2)),self.HitAtten,55,self.HitVolume,CHAN_BODY)end;function SWEP:PrimaryAttack()local b=self:GetOwner()if self:IsPouncing()or CurTime()<self:GetNextPrimaryFire()or not b:IsOnGround()or self:GetAttackStillTime()~=0 or self:IsBurrowing()then return end;self.PoundAttackStart=CurTime()local n=b:GetAimVector()n.z=math.max(0.45,n.z)n:Normalize()b:SetGroundEntity(NULL)b:SetVelocity(n*self.PounceVel)b:DoAnimationEvent(ACT_RANGE_ATTACK1)if SERVER then self:EmitAttackSound()end;self.ViewingAngles=b:EyeAngles()self:SetPouncing(true)end;function SWEP:SecondaryAttack()local b=self:GetOwner()if self:IsAttacking()or self:IsPouncing()or not b:IsOnGround()or self:IsBurrowing()then return end;local o=b:GetMeleeSpeedMul()self:SetAttackStartTime(CurTime())self:SetAttackProcessTime(CurTime()+self.AttackProcessTime)self:SetAttackStillTime(CurTime()+self.AttackStillTime)self:SetNextSecondaryFire(CurTime()+self.Secondary.Delay*o*(1+b:GetModVal("ability_cooldown")*0.5))if SERVER then self:EmitAttackSound()end end;function SWEP:Reload()end;function SWEP:Move(p)if self:IsPouncing()then if self:GetFireMode()==1 then p:SetSideSpeed(0)p:SetForwardSpeed(0)else if CurTime()<self.PoundAttackStart+0.1 then local n=p:GetVelocity()n.z=300;self:GetOwner():SetGroundEntity(NULL)p:SetVelocity(n)end;local q=p:GetMaxSpeed()*5;p:SetMaxSpeed(q)p:SetMaxClientSpeed(q)return true end elseif self:IsBurrowed()then p:SetMaxSpeed(400)p:SetMaxClientSpeed(400)elseif self:IsBurrowing()then p:SetSideSpeed(0)p:SetForwardSpeed(0)p:SetVelocity(Vector(0))return true end;if self:GetAttackStillTime()~=0 then p:SetMaxSpeed(50)p:SetMaxClientSpeed(50)return true end end;function SWEP:HandleOwnerCustomCollision()local b=self:GetOwner()local r=self:GetBurrowTime()if r>0 then b:SetCustomGroupAndFlags(bit.bor(ZS_COLLISIONGROUP_ZOMBIE_NOCOLLIDED,ZS_COLLISIONGROUP_NOCOLLIDE_TEAM),ZS_COLLISIONFLAGS_NOCOLLIDE_TEAM)return true end end;function SWEP:Burrow()local b=self:GetOwner()if self:GetPouncing()or not b:IsOnGround()or self:GetAttackProcessTime()~=0 or self.RocksLeft>0 then return end;if self:GetBurrowTime()==0 and self:GetNextBurrowTime()<CurTime()then if self:CanBurrow()then self:BurrowDown()end elseif self:GetBurrowTime()>0 and CurTime()>=self:GetBurrowTime()then self:BurrowUp()end end;function SWEP:BurrowDown()local b=self:GetOwner()self:SetBurrowingStamina(1)self:SetBurrowTime(CurTime()+self.BurrowTime)if SERVER then b:EmitSound("npc/antlion/digdown1.wav",70,90)b:EmitSound("npc/ichthyosaur/attack_growl"..math.random(3)..".wav",50,135)b:ResetPlayerCollision()local o=b:GetMeleeSpeedMul()self:SetNextBurrowTime(CurTime()+self.BurrowCooldown*o*(1+b:GetModVal("ability_cooldown")*0.5))local c=EffectData()c:SetOrigin(b:GetPos())c:SetAngles(b:GetAngles())util.Effect("propmonster_rock_pull",c,nil,true)end end;function SWEP:BurrowUp()local b=self:GetOwner()self:SetBurrowingStamina(1)self:SetBurrowTime(-(CurTime()+self.UnburrowTime))if SERVER then self:UnburrowAttackProcess()b:EmitSound("npc/antlion/digup1.wav",70,90)local o=b:GetMeleeSpeedMul()self:SetNextBurrowTime(CurTime()+self.BurrowCooldown*o*(1+b:GetModVal("ability_cooldown")*0.5))b:TemporaryNoCollide(true)local c=EffectData()c:SetOrigin(b:GetPos())c:SetAngles(b:GetAngles())util.Effect("propmonster_rock_pull",c,nil,true)end end;local s={mask=MASK_SOLID_BRUSHONLY}function SWEP:CanBurrow()local b=self:GetOwner()if not b:IsOnGround()or b:WaterLevel()>=2 then return false end;s.start=b:GetPos()%4;s.endpos=s.start+Vector(0,0,-128)local i=util.TraceLine(s)return i.HitWorld end;function SWEP:EmitIdleSound()local j=self:GetOwner():CompensatedMeleeTrace(4096,24).Entity;if j:IsValidPlayer()then self:GetOwner():EmitSound("npc/headcrab/idle"..math.random(3)..".wav",75,60)else self:GetOwner():EmitSound("npc/headcrab/alert1.wav",75,60)end end;function SWEP:EmitAttackSound()self:GetOwner():EmitSound("npc/ichthyosaur/attack_growl"..math.random(3)..".wav",75,135)end;function SWEP:EmitPukeSound()local b=self:GetOwner()local t="weapons/rpg/rocketfire1.wav"for u=1,3 do timer.Simple(0.04*u,function()if b:IsValid()then b:EmitSound(t,75,130+u*5,0.5,CHAN_AUTO+u)end end)end end;function SWEP:IsAttacking()return self:GetAttackStartTime()>0 end;function SWEP:GetAttackEndTime()return self:GetAttackStartTime()+self.AttackTime end;function SWEP:SetPouncing(v)if not v then self.ViewingAngles=nil end;self:SetDTBool(1,v)end;function SWEP:IsPouncing()return self:GetDTBool(1)end;SWEP.GetPouncing=SWEP.IsPouncing
