,color=Color(105,105,105,255),surpresslightning=false,material="",skin=0,bodygroup={}},["barrel+++"]={type="Model",model="models/props_combine/combine_train02a.mdl",bone="ValveBiped.Bip01_L_Hand",rel="barrel++",pos=Vector(0,11.961,0),angle=Angle(0,0,0),size=Vector(0.035,0.004,0.029),color=Color(105,105,105,255),surpresslightning=false,material="models/props_pipes/destroyedpipes01a",skin=0,bodygroup={}},["BARREL2+"]={type="Model",model="models/props_combine/combinebutton.mdl",bone="ValveBiped.Bip01_L_Hand",rel="barrel++",pos=Vector(-0.138,-14.155,-0.889),angle=Angle(180,-90,-90),size=Vector(0.352,0.356,0.18),color=Color(105,105,105,255),surpresslightning=false,material="models/props_pipes/destroyedpipes01a",skin=0,bodygroup={}},["bottom2+"]={type="Model",model="models/props_wasteland/laundry_washer003.mdl",bone="ValveBiped.Bip01_L_Hand",rel="barrel++",pos=Vector(0,-5.393,-3.069),angle=Angle(180,90,0),size=Vector(0.143,0.07,0.057),color=Color(105,105,105,255),surpresslightning=false,material="models/props_pipes/destroyedpipes01a",skin=0,bodygroup={}}}SWEP.ViewModelBoneMods={["v_weapon.elite_right"]={scale=Vector(1,1,1),pos=Vector(0,-0.19,-4.318),angle=Angle(0,0,-3)},["ValveBiped.Bip01_Spine4"]={scale=Vector(1,1,1),pos=Vector(0,0,0),angle=Angle(0,4.721,0)},["ValveBiped.Bip01_L_Hand"]={scale=Vector(1,1,1),pos=Vector(0,0,0),angle=Angle(7,0,0)},["v_weapon.elite_left"]={scale=Vector(1,1,1),pos=Vector(0,0.126,-3.794),angle=Angle(0,0,-3)},["ValveBiped.Bip01_R_Hand"]={scale=Vector(1,1,1),pos=Vector(0,0,0),angle=Angle(-7,0,0)}}end;SWEP.Base="weapon_zs_base"DEFINE_BASECLASS("weapon_zs_base")SWEP.HoldType="duel"SWEP.ViewModel="models/weapons/cstrike/c_pist_elite.mdl"SWEP.WorldModel="models/weapons/w_pist_elite.mdl"SWEP.FakeWorldModel="models/weapons/w_shotgun.mdl"SWEP.UseHands=true;SWEP.NoVMShiftX=true;SWEP.Primary.Damage=16;SWEP.Primary.NumShots=8;SWEP.Primary.Delay=0.4;SWEP.Primary.ClipSize=8;SWEP.Primary.Ammo="buckshot"GAMEMODE:SetupDefaultClip(SWEP.Primary)SWEP.ConeMax=6.75;SWEP.ConeMin=6;SWEP.HasDeliberation=false;GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MAX_SPREAD,-0.55,1)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MIN_SPREAD,-0.4,1)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_CULL,0.02,1)SWEP.Tier=6;SWEP.FireAnimSpeed=1.65;SWEP.ReloadSpeed=0.805;SWEP.ReloadAnim=ACT_VM_DRAW;SWEP.CloseGunLeech=GAMEMODE.CloseRangeGunLeech;SWEP.Cull=0.06;SWEP.MaxBar=90;SWEP.WeaponBuildup={Colour={150,0,150,255},Name="Stacks",NameFull="Reaper Projectile",Requirement=SWEP.MaxBar,Type="reaper"}local a=GAMEMODE:AddNewRemantleWep("weapon_zs_abzats")a.CollectiveName="Abzats"function SWEP:PrimaryAttack()local b=self:GetOwner()if b:GetStatus("buff_stack_reaper")then if not self.SaveCull then self.SaveCull=self.Cull;self.Cull=nil end elseif self.SaveCull then self.Cull=self.SaveCull;self.SaveCull=nil end;return BaseClass.PrimaryAttack(self)end;function SWEP:OnZombieKilled(c,d,e)if e then return end;local f=self:GetOwner()if f:IsValid()then f:GiveStack("buff_stack_reaper")end end;function SWEP:GetStackType()return self.WeaponBuildup.Type end;function SWEP:GetWeaponBuildup()local f=self:GetOwner()if f:IsValid()then local g=f:GetStatus("buff_stack_reaper")local h=f:GetStatus("buff_stack_broadside")if g then if self:GetStackType()~="reaper"then self.WeaponBuildup={Colour={150,0,150,255},Name="Stacks",NameFull="Reaper Projectile",Requirement=self.MaxBar,Type="reaper"}end elseif h then if self:GetStackType()~="broadside"then self.WeaponBuildup={Colour={30,130,140,255},Name="Stacks",NameFull="Broadside Projectile",Requirement=self.MaxBar,Type="broadside"}end end;local i=g or h;if IsValid(i)then return math.min(self.MaxBar,i:GetStacks()*30)end end;return 0 end;function SWEP:SecondaryAttack()if not self:CanPrimaryAttack()then return end;if self:GetWeaponBuildup()>=self.MaxBar and self:GetCombinedPrimaryAmmo()>=3 then local b=self:GetOwner()self:EmitFireSound()self:SendWeaponAnimation()self:TakeCombinedPrimaryAmmo(3)self:CalculateNextAttackTime(self:GetFireDelay()*2)b:DoAttackEvent(true)b:ViewPunch(Angle(3,0,3))if SERVER then local j=self:ShootProjectile(self.Primary.Damage*8*2.6,0,"projectile_deathdealers",200)j.Gravity=0;j:SetDTInt(0,self:GetStackType()=="reaper"and 1 or self:GetStackType()=="broadside"and 2 or 1)self:DoConsumeBuildup(true)local k="buff_stack_"..self:GetStackType()local l=b:GetStatus(k)if l:GetStacks()<=3 then b:RemoveStatus(k)else l:SetStacks(l:GetStacks()-3)end end end end;function SWEP:Reload()local b=self:GetOwner()if b:IsHolding()or not self:CanReload()then return end;if SERVER then for m=1,2 do local n=ents.Create("prop_fakeweapon")if n:IsValid()then n:SetOwner(b)n:SetWeaponType(self:GetClass())local o=b:EyePos()+b:EyeAngles():Right()*(m==1 and 8 or-8)n:SetPos(o)n:SetAngles(VectorRand():Angle())n:Spawn()n:SetCollisionGroup(COLLISION_GROUP_WORLD)local p=n:GetPhysicsObject()if p:IsValid()then p:AddAngleVelocity(Vector(math.Rand(-420,420),math.Rand(-420,420),math.Rand(-420,420)))p:ApplyForceCenter(p:GetMass()*b:GetAimVector()*math.random(64,128))end end;ProjectileTransmitFilter(b,n)end end;BaseClass.Reload(self)end;function SWEP:SendWeaponAnimation()local q=self:GetOwner():GetViewModel()if not IsValid(q)then return end;q:SendViewModelMatchingSequence(self:Clip1()%2==0 and 5 or 2)q:SetPlaybackRate(self:GetIronsights()and self.IronsightAnimSpeed or self.FireAnimSpeed)end;function SWEP:EmitFireSound()self:EmitSound("weapons/shotgun/shotgun_dbl_fire.wav",75,math.random(125,130),0.3)self:EmitSound("weapons/zs_dds/zs_dd.ogg",75,math.random(115,120),1,CHAN_WEAPON+39)end;if not CLIENT then return end;function SWEP:GetTracerOrigin()local b=self:GetOwner()if b:IsValid()then local q=b:GetViewModel()if q and q:IsValid()then local r=q:GetAttachment(self:Clip1()%2+3)if r then return r.Pos end end end end
