SWEP.Base="weapon_zs_owens"DEFINE_BASECLASS("weapon_zs_owens")SWEP.PrintName="'Coordinator' Node Placer"SWEP.Description="An upgraded version of the Sigil Placer. Allows the user to create and view nodes for sigils, drop points, the nydus worm, and more. Please make sure placed nodes abide by the established guidelines."SWEP.ViewModel="models/weapons/c_pistol.mdl"SWEP.WorldModel="models/weapons/w_pistol.mdl"SWEP.UseHands=true;SWEP.Primary.ClipSize=-1;SWEP.Primary.DefaultClip=-1;SWEP.Primary.Automatic=false;SWEP.Primary.Ammo="none"SWEP.Secondary.ClipSize=-1;SWEP.Secondary.DefaultClip=-1;SWEP.Secondary.Automatic=false;SWEP.Secondary.Ammo="none"SWEP.AllowQualityWeapons=false;SWEP.PermitDismantle=true;SWEP.DismantleScrap=0;SWEP.PermitDismantle=true;SWEP.Undroppable=true;SWEP.UnGiveable=true;PLACER_SIGIL=0;PLACER_CONTROL=1;PLACER_DROP=2;PLACER_WORM=3;function SWEP:Initialize()self:AddFireMode("Sigil Placer","SIGIL",nil,function()self.SigilPlacerMode=PLACER_SIGIL end)self:AddFireMode("Control Point Placer","CTRL",nil,function()self.SigilPlacerMode=PLACER_CONTROL end)self:AddFireMode("Drop Placer","DROP",nil,function()self.SigilPlacerMode=PLACER_DROP end)self:AddFireMode("Nydus Placer","WORM",nil,function()self.SigilPlacerMode=PLACER_WORM end)end;function SWEP:Break()if self.Breaking then return end;self.Breaking=true;local a=self:GetOwner()if IsFirstTimePredicted()then sound.Play(")physics/metal/metal_box_break1.wav",a:WorldSpaceCenter(),75,200)end;if not SERVER then return end;a:CenterNotify("The gun falls to pieces as soon as you pull the trigger, dashing your dreams of finally adding that OP sigil spot.")a:ViewPunch(Angle(-50,0,0))timer.Simple(math.random(2,4),function()RollForContraband(a,1,"Got another pack of","Looking back at the crate, you find a hidden compartment!")end)self:Remove()end;function SWEP:PrimaryAttack()if not self.Breaking then self:Break()end end;function SWEP:SecondaryAttack()if not self.Breaking then self:Break()end end;function SWEP:Reload()if not self.Breaking then self:Break()end end;if not CLIENT then return end;local b={{"[PRIMARY FIRE] - Place Node",color_white},{"[PRIMARY FIRE] (on sigil) - Edit Sigil",COLOR_CYAN,true},{"[SECONDARY FIRE] - Remove Node",COLOR_RED},{''},{"[RELOAD] (hold) - Clear nodes",COLOR_ORANGE}}local c="ZSHUDFontSmaller"function SWEP:DrawHUD(...)local d=BetterScreenScale()local e=32*d;local f=200*d;surface.SetFont(c)local g,h=surface.GetTextSize("W")local i=0;for g,j in ipairs(b)do local k=j[3]if self:GetFireMode()~=PLACER_SIGIL and k then continue end;draw.SimpleText(j[1],c,e,f+i,j[2])i=i+h end end
