SWEP.Base="weapon_zs_basedeployer"SWEP.PrintName="Health Charger"SWEP.Description="A health charging station that can be used to heal through continous use. Can only be refilled through re-deployment or the use of a multi-tool. Primary attack to deploy. Secondary attack to rotate."SWEP.WorldModel=Model("models/props_combine/health_charger001.mdl")SWEP.Primary.Ammo="healthcharger"SWEP.MaxStock=5;SWEP.DeployableAmmoType="battery"SWEP.DeployableAmmoStartAmount=150;SWEP.GhostStatus="ghost_healthcharger"SWEP.DeployClass="prop_healthcharger"function SWEP:ApplyPackedENTValues(a)local b=self:GetOwner()local c=b:PopPackedItem(a:GetClass())if c then a:SetObjectHealth(c[1])a:SetChargeAvailable(c[2])a.LastUsed=c[3]end end
