eturn end;local i,j=h:GetTranslation(),h:GetAngles()local k=self.HUD3DPos;i=i+j:Forward()*k.x+j:Right()*k.y+j:Up()*k.z;j:RotateAroundAxis(j:Up(),math.sin(CurTime()*math.pi)*20)j:RotateAroundAxis(j:Right(),CurTime()*180)i=i+j:Forward()*7;j:RotateAroundAxis(j:Right(),270)j:RotateAroundAxis(j:Up(),180)local l,m=144,144;local n,o=l*-0.5,m*-0.5;local p=self:GetPrimaryAmmoCount()cam.Start3D2D(i,j,0.0125)draw.RoundedBox(32,n,o,l,m,d)draw.SimpleText(p,"ZS3D2DFontBig",n+l*0.5,o+m*0.5,e,TEXT_ALIGN_CENTER,TEXT_ALIGN_CENTER)cam.End3D2D()end
