owbar.mdl"SWEP.UseHands=true;SWEP.HoldType="melee2"SWEP.MeleeDamage=50;SWEP.MeleeRange=63;SWEP.MeleeSize=1.5;SWEP.MeleeKnockBack=250;SWEP.DamageScaling=1.1;SWEP.WalkSpeed=SPEED_SLOW;SWEP.Primary.Delay=1.1;SWEP.SwingTime=0.01;SWEP.SwingRotation=Angle(90,0,0)SWEP.SwingOffset=Vector(0,-30,0)SWEP.SwingHoldType="melee"SWEP.BlockRotation=Angle(20,10,-30)SWEP.BlockOffset=Vector(5,5,10)SWEP.Stability=WEAPON_STABILITY_WEAK;SWEP.BlockReduction=WEAPON_BLOCK_REDUCTION_VERY_WEAK;SWEP.HitDecal="Manhackcut"SWEP.AllowQualityWeapons=true;SWEP.EssenceType=ESSENCE_CADER;SWEP.RepairTool=true;SWEP.StaminaUsage=0.14;SWEP.Radius=100;SWEP.HealStrength=21;SWEP.RepairTicks=1;SWEP.HeavyTimeMulti=0;SWEP.HeavyMulti=1;SWEP.HeavyMultiAddCapLow=3;SWEP.HeavyMultiAddCapHigh=9;SWEP.HeavyMultiPerSecLow=1.5;SWEP.HeavyMultiPerSecHigh=0.5;SWEP.IsBanished=true;SWEP.Tier=2;SWEP.WeaponBuildup={Colour={210,155,100,255},Name="Charge",Requirement=1}GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_RANGE,3,1)GAMEMODE:AttachCustomWeaponModifier("RepairTicks","Repair Novas On Kill",1,3,true)function SWEP:PlaySwingSound()self:EmitSound(")weapons/iceaxe/iceaxe_swing1.wav",65,math.random(55,65),0.55,CHAN_WEAPON)end;function SWEP:PlayHitSound()self:EmitSound(")physics/metal/metal_canister_impact_hard"..math.random(3)..".wav",100,math.random(115,125),0.65,CHAN_WEAPON)end;function SWEP:Think()BaseClass.Think(self)local a=math.Clamp((CurTime()-self:GetWindStart())/((self.HeavyMultiAddCapHigh+self.HeavyMultiAddCapLow)*0.2),0,1)self:SetWeaponBuildup(self:IsWinding()and a or 0)end;function SWEP:PostHitUtilExtend(b,c,d,e,f)local g=math.Clamp(self.LastWindTime*self.HeavyMultiPerSecLow,0,self.HeavyMultiAddCapLow)local h=math.Clamp((self.LastWindTime-self.HeavyMultiAddCapLow/self.HeavyMultiPerSecLow)*self.HeavyMultiPerSecHigh,0,self.HeavyMultiAddCapHigh)local i=1+g+h;d:SetDamage(d:GetDamage()*i)return b,c,d,e,f end;function SWEP:StopWind()self.LastWindTime=CurTime()-self:GetWindStart()self:SetWindStart(0)self:SetWeaponBuildup(0)end;function SWEP:Holster()BaseClass.Holster(self)self:StopWind()return true end;function SWEP:OnZombieKilled(j,d,k)if k then return end;local b=self:GetOwner()local l=j:WorldSpaceCenter()local m=self.HealStrength*(b:GetModVal("repair_rate")or 1)if b:IsValidLivingHuman()then for n=1,self.RepairTicks do timer.Simple(n-1,function()if not IsValid(self)then return end;local o=EffectData()o:SetOrigin(l)EffectTransmitFilter("explosion_nanitecloud",o,nil,b)for p,c in pairs(util.BlastAlloc(self,self,l,self.Radius,1))do if not c:IsValid()or c==self then continue end;local q=false;if c:IsNailed()then c:Reinforce(5,b)local r=c:GetBarricadeHealth()if r<=0 or r>=c:GetMaxBarricadeHealth()or c:GetBarricadeRepairs()<=0.01 then continue end;c:SetBarricadeHealth(math.min(c:GetMaxBarricadeHealth(),c:GetBarricadeHealth()+math.min(c:GetBarricadeRepairs(),m)))q=c:GetBarricadeHealth()-r;c:SetBarricadeRepairs(math.max(c:GetBarricadeRepairs()-q,0))local s=b:GetModVal("mending")if s>0 then local t=c:GiveStatus("nail_repair")if t and t:IsValid()then t:AddRepairAmount(m*s,b)end end elseif c.GetObjectHealth and c.GetMaxObjectHealth and not c.FleshCraft then if c.HitByWrench and c:HitByWrench(self,b,nil)then continue end;local r=c:GetObjectHealth()if r<=0 or r>=c:GetMaxObjectHealth()or c.PropLastDamaged and CurTime()<c.PropLastDamaged+4 then continue end;c:SetObjectHealth(math.min(c:GetMaxObjectHealth(),c:GetObjectHealth()+m/2))q=c:GetObjectHealth()-r end;if q and b:IsValidLivingHuman()then c:EmitSound("npc/dog/dog_servo"..math.random(7,8)..".wav",70,math.random(100,105))gamemode.Call("PlayerRepairedObject",b,c,q,self)o=EffectData()o:SetOrigin(c:GetPos())o:SetNormal((self:GetPos()-c:GetPos()):GetNormalized())o:SetMagnitude(1)EffectTransmitFilter("nailrepaired",o,true,b)end end end)end end end
