SWEP.Base="weapon_zs_basedeployer"SWEP.PrintName="Remantler"SWEP.Description="A deployable device capable of upgrading weapons and deployables with scrap.\nIt can be used to assemble trinkets and ammo with scrap also.\nWhen people use a remantler you put down, you get some scrap in return so make sure to place them down.\nPress PRIMARY ATTACK to deploy the remantler.\nPress SECONDARY ATTACK and RELOAD to rotate the remantler."SWEP.WorldModel=Model("models/jamz999/remantler.mdl")SWEP.Primary.Ammo="remantler"SWEP.MaxStock=5;SWEP.NearSigilToBuy=true;SWEP.GhostStatus="ghost_remantler"SWEP.DeployClass="prop_remantler"
