if q then return end;local a=self:GetOwner()if a:IsValidLivingHuman()then a:AddLeech(math.random(6,12)+self.KillLeechBonus,nil,nil,self)end end;if not CLIENT then return end;local r=Color(16,16,16,90)function SWEP:Draw3DHUD(k,l,m)local s,t,u,v;local w=Style.Sunhud()and"ZSSHUD3D2DFontSmall"or"ZS3D2DFontSmall"if Style.Sunhud()then s,t=130,150;u,v=s*-0.6,t*-0.5 else s,t=180,200;u,v=s*-0.6,t*-0.5 end;cam.Start3D2D(l,m,self.HUD3DScale/2)local c=self:GetDamageBonus()local x="DMG MULTI: "..c;surface.SetDrawColor(Style.Sunhud()and SH_COLOR_BLACK_BACKGROUND_HUD or r)surface.DrawRect(u,v,s,t)draw.SimpleTextBlurry(x,w,u+s/2,v+t*0.9,COLOR_ORANGE,TEXT_ALIGN_CENTER,TEXT_ALIGN_CENTER)cam.End3D2D()return BaseClass.Draw3DHUD(self,k,l,m)end;function SWEP:Draw2DHUD()local y=BetterScreenScale()local s,t,u,v;local w=Style.Sunhud()and"ZSSHUDFontNumericLarge"or"ZSHUDFontSmall"if Style.Sunhud()then s,t=180*y,64*y;u,v=ScrW()-s-y*128+(GAMEMODE.AmmoBarX or 0),ScrH()-t-y*72+(GAMEMODE.AmmoBarY or 0)else s,t=180*y,64*y;u,v=ScrW()-s-y*128+(GAMEMODE.AmmoBarX or 0),ScrH()-t-y*72+(GAMEMODE.AmmoBarY or 0)end;local c=(self:GetDamageBonus()-1)*100;local x="DMG: +"..c.."%"draw.SimpleText(x,w,u+s*0.5,v+t*1,COLOR_ORANGE,TEXT_ALIGN_CENTER,TEXT_ALIGN_CENTER)return BaseClass.Draw2DHUD(self)end
