pSpinningSound()return BaseClass.Holster(self)end;function SWEP:OnRemove()self:StopSpinningSound()return BaseClass.OnRemove(self)end;function SWEP:StopSpinningSound()if CLIENT then self.SpinningSound:Stop()end end;function SWEP:Think()if self.TwirlAnimStart and self.TwirlAnimStart<=CurTime()and self:Clip1()==1 then self.TwirlAnimStart=nil;self:SendWeaponAnim(ACT_VM_HAULBACK)end;if CLIENT and self:Clip1()==1 then self.SpinningSound:PlayEx(1,150+CurTime()%5)end;if self:Clip1()==1 and self:GetQuadDamageMulti()==1 then self:FinishReload()self:EmitSound(")weapons/zs_whisper/jhin_clipin.ogg")self:SendWeaponAnim(ACT_VM_FIDGET)self:StopSpinningSound()end;if CLIENT then if not self.NextVoiceLine then self.NextVoiceLine=CurTime()+math.random(15,60)end;if self.NextVoiceLine and self.NextVoiceLine<=CurTime()then self:EmitSound(")zombiesurvival/weapon_zs_virtuoso/jhin"..math.random(1,12)..".ogg")self.NextVoiceLine=CurTime()+math.random(15,40)end end;self.BaseClass.Think(self)end;function SWEP:ShootBullets(a,b,c)local d=self:GetOwner()if self:Clip1()==0 then a=a*self:GetQuadDamageMulti()self.Pens=10;d:GiveStatus("buff_adrenaline",self.SpeedDuration)end;if self:Clip1()==1 then self:SetQuadDamageTime(CurTime()+self.QuadDamageDecayStartTime)end;if CLIENT then self.SpinningSound:Stop()end;self.BaseClass.ShootBullets(self,a,b,c)self.Pens=nil end;function SWEP.BulletCallback(e,f,g,h)local i=f.Entity;if SERVER and i:IsValidLivingZombie()and e:IsHeadshot(f.HitGroup,i,g)then local d=e;local j=g:GetInflictor()if IsValid(d)and IsValid(j)and d==j:GetOwner()then d:GiveStatus("buff_adrenaline",5)end end end;function SWEP:FinishReloadEffects()self.TwirlAnimStart=CurTime()+self:SequenceDuration()*0.4 end;function SWEP:SendWeaponAnimation()local k=ACT_VM_PRIMARYATTACK;if self:Clip1()==0 then k=ACT_VM_SECONDARYATTACK elseif self:Clip1()==1 then self.TwirlAnimStart=CurTime()+self:SequenceDuration()*0.4 end;self:SendWeaponAnim(k)if CLIENT then self:PlaySoundScript(k)end end;function SWEP:OnCull(l,g)